import React from "react";
import { Progress } from "reactstrap";

type Props = {
  text: string;
  percent: number;
};
const PercentageProgressBar = ({ text, percent }: Props) => {
  return (
    <React.Fragment>
      <div>{text}</div>
      <Progress value={percent}>{percent}%</Progress>
    </React.Fragment>
  );
};

export default PercentageProgressBar;
